import React, { useState, useEffect, useRef } from 'react';
import { motion, AnimatePresence } from 'framer-motion';
import './LandingPage.css';
import logo from '../assets/logo.png';

const LandingPage = () => {
  const [started, setStarted] = useState(false);
  const [showIntro, setShowIntro] = useState(true);
  const [swiped, setSwiped] = useState(false);
  const audioRef = useRef(null);

  const handleStart = () => {
    setStarted(true);
    audioRef.current.play().catch((err) => {
      console.warn('Autoplay blocked by browser:', err);
    });

    setTimeout(() => {
      setShowIntro(false);
      audioRef.current.pause();
      audioRef.current.currentTime = 0;
    }, 5000);
  };

  const handleDragEnd = (event, info) => {
    if (info.offset.y < -150) {
      setSwiped(true);
    }
  };

  return (
    <div className="landing-container">
      <audio ref={audioRef} src="/intro.mp3" preload="auto" />

      {!started ? (
        <div className="start-screen">
          <h1>SUPRA STUDIOS</h1>
          <button onClick={handleStart} className="start-btn">Enter</button>
        </div>
      ) : showIntro ? (
        <motion.div
          className="logo-wrapper"
          initial={{ opacity: 0, scale: 0.5, rotate: -180 }}
          animate={{ opacity: 1, scale: 1, rotate: 0 }}
          transition={{ duration: 2.5 }}
        >
          <img src={logo} alt="SUPRA Logo" className="logo-animated" />
          <motion.h1
            className="studio-text"
            initial={{ opacity: 0, y: 50 }}
            animate={{ opacity: 1, y: 0 }}
            transition={{ delay: 2, duration: 1.5 }}
          >
            SUPRA STUDIOS
          </motion.h1>
        </motion.div>
      ) : !swiped ? (
        <motion.div
          className="welcome-slide"
          drag="y"
          dragConstraints={{ top: 0, bottom: 0 }}
          onDragEnd={handleDragEnd}
          initial={{ y: 0 }}
          animate={{ y: 0 }}
        >
          <h1 className="welcome-heading">Welcome to SUPRA STUDIOS</h1>
          <p className="welcome-subtext">Swipe up to explore</p>
          <div className="swipe-indicator">⬆️</div>
        </motion.div>
      ) : (
        <motion.div
          className="homepage full-section"
          initial={{ backgroundColor: "#7c0a02", opacity: 0 }}
          animate={{ opacity: 1 }}
          transition={{ duration: 1 }}
        >
          <motion.h2 className="section-title" initial={{ y: 30, opacity: 0 }} animate={{ y: 0, opacity: 1 }} transition={{ duration: 1 }}>
            Our Vision
          </motion.h2>
          <p className="section-text">
            To make the world turn and look at us through the power of our stories.
          </p>

          <motion.h2 className="section-title" initial={{ y: 30, opacity: 0 }} animate={{ y: 0, opacity: 1 }} transition={{ delay: 0.3, duration: 1 }}>
            Our Mission
          </motion.h2>
          <p className="section-text">
            We aim to craft cinema that moves hearts, starts conversations, and brings real stories to life.
          </p>

          <motion.h2 className="section-title" initial={{ y: 30, opacity: 0 }} animate={{ y: 0, opacity: 1 }} transition={{ delay: 0.6, duration: 1 }}>
            Our Journey
          </motion.h2>
          <p className="section-text">
            Founded in 2025, Supra Studios started with a passion for storytelling. With deep cultural roots and cinematic ambition, we’re here to make a mark.
          </p>

          <div className="cards-section">
            <div className="info-card">Services</div>
            <div className="info-card">About Us</div>
            <div className="info-card">Contact</div>
          </div>
        </motion.div>
      )}
    </div>
  );
};

export default LandingPage;
